import React, {useState} from 'react';
import ListImageGif from '../../components/ListImageGif';




const Home = () => {

  const [value, setValue] = useState("Star Wars");

  return (
    <div className="Home">
      <input onChange={(e) => setValue(e.target.value)} className='form-control mb-4' placeholder='Star Wars'/>
      <ListImageGif search={value}/>
    </div>
  );
}

export default Home;
